    const [count, setCount] = useState(10);
    const [posts, setPost] = useState([]);

    useEffect(() => {
        Axios.get('https://jsonplaceholder.typicode.com/users')
            .then(res => {
                console.log(res.data[0].title);
                setPost(res.data)
            })
            .catch(err => console.log(err))

    }, []);




    return (
        <div>

            <table>
                <tr>
                    <th>Company</th>
                    <th>Contact</th>
